import React from 'react';
import '../App.css';
import api from "../actions/api.js";

class Users extends React.Component {

    state = {
        users: []
    };
    
    loadUsers() {
        api.registerUser().fetchAll().then(res => {
            res.data.filter( user => user.email!== localStorage.getItem('userEmail') )
        }).then(res => this.setState({ users: res }))
    }

    render (){
        if(localStorage.getItem('userEmail')){
            this.loadUsers();
            console.log(this.state);
            return (
                <div class="container">
                <br></br><br></br>
                    <div class="row justify-content-center">
                        <div class="col-md-12">
                            <div class="card">
                                <div class="card-header">Users</div>
                                <div class="card-body">
                                    <table class="table">
                                        <thead>
                                            <tr>
                                                <th class="tableTh">#</th>
                                                <th class="tableTh">First Name</th>
                                                <th class="tableTh">Last Name</th>
                                                <th class="tableTh">Email</th>
                                                <th class="tableTh">Phone</th>
                                                <th class="tableTh">User Type</th>
                                                <th class="tableTh">Change</th>
                                                <th class="tableTh">Remove User</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            <tr>
                                                
                                                <td class="tableTh">{this.state.users}</td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                                <td class="tableTh"></td>
                                            </tr>
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            );
        }
    }
}

export default Users;
